import SideNavBar from "../Components/SideNavBar";
import Box from "@mui/material/Box";
im

function Publisher() {
  return (
    <>
    <NavBar />
      <Box height={30}/>
      <Box sx={{ display: "flex" }}>
        <SideNavBar />

        <Box component="main" sx={{ flexGrow: 1, p: 3 }}>
          <h1>Publisher</h1>
        </Box>
      </Box>
    </>
  );
}
export default Publisher;
